import React, { Component } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import './SignIn.scss';

// $accent-color: linear-gradient(90deg,#ed145b 0,#7b31f4);


const SignIn = () => {
   
    return (
      <div className='sign-in'>
        <h1 className='sign-in-title'>Sign in</h1>
        <form className="signin-form">
        <div>
          <TextField   
          sx={{
            width: '100%',
            '&:hover .MuiFilledInput-root:before': {
              borderBottom: '2px solid #e00bcb'
            } 
          }}
          id="filled-basic" 
          label="Email" 
          variant="filled"
          required
          />
        </div>
          <div>
          <TextField   
          sx={{
            width: '100%',
            '&:hover .MuiFilledInput-root:before': {
              borderBottom: '2px solid #e00bcb'
            } 
          }}
          id="filled-basic" 
          label="password" 
          variant="filled"
          required
        />
          </div>
         
          <Button
            sx={{
              marginTop: '50px',
              borderRadius: '0px',
              backgroundColor: '#e00bcb'
            }}
            variant="contained" 
            size="large"
          >
            Large
          </Button>      
        </form>
      </div>
    )
  
}

export default SignIn;
